.panelGroup {
    width: 100%;
    height: 100%;
    padding-top: 5%;
    display: flex;
    flex-direction: column;

    // 搜索框
    .search {
        display: flex;

        .el-input {
            width: 515px;
            height: 40px;

            .el-input__inner {
                height: 100%;
            }

            .el-button {
                width: 75px;
                height: 40px;
                font-size: 16px;
                background: #90C41E;
                color: #fff;
            }
        }
    }

    // 历史记录
    .history {
        width: 500px;

        h5 {
            display: flex;
            justify-content: space-between;
            align-items: center;
            color: #90C41E;
            span {
                font-weight: 400;
            }
        }

        .historyList {
            max-height: 150px;
            overflow: hidden;
            .el-tag {
                height: 30px;
                margin: 5px;
                line-height: 28px;
                cursor: pointer;
            }
        }

    }

    // 按钮
    .btnList {
        margin-top: 30px;
    }
}
